        super(props);

        this.state({
            title: this.props.title
        })
    }

    PerklevelClicked (perkLevel) {
        console.log("PerklevelClicked", this.state.title);

    }

    render() {
        return (
                <div className="perktree-container">
                    <ul className="perk">
                        <li className="perk-level title"><span>{this.props.title}</span></li>
                        <Perklevel onClick={() => this.PerklevelClicked(1)} image={image_placeholder}/>
                        <Perklevel image={image_placeholder}/>
